import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App" >
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reloa.
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>


    <iframe src="https://trinket.io/embed/pygame/f9650decb4?outputOnly=true" width="900" height="500" frameborder="0" marginwidth="0" marginheight="0"></iframe>


    </div>
  );
}

export default App;
